static char *
strdup_bs(const char *s)
{
	int l;
	char *r, *ret;

	l = strlen(s);
	ret = r = (char*) malloc(l+1);


	for(; *s; s++,r++)
	{
		if (*s=='\\' && s[1])
		{
			s++;
		}
		*r = *s;
	}
	*r = 0;

	return ret;
}


