static char *
marker_id(char *str)
{
	char *b = str;
	char *e = b + strlen(b);
	char *s;
	int l;

	for (;b<e; b++)
	{
		if (is_id(*b))
			break;
	}

	for(;b<e; e--)
	{
		if (is_id(e[-1]))
			break;
	}

	l = e-b;
	s = mem_dup(b, l);

	return s;
}

